import { Routes, Route } from 'react-router-dom';

import About from './About/About.js';
import Nav from './Nav';
import Home from './Home/Home.js';

function Layout() {
  return (
    <>
      <Nav />
      <div className='container'>
        <Routes>
          <Route path='*' element={<Home />}>
            <Route path='/about' element={<About />}/>
          </Route>
        </Routes>
      </div>
    </>
  )
}

export default Layout;
